import React, {Component} from 'react'
import BookImage from '../../asserts/js/images'

export class Blog extends Component {
    constructor(props) {
        super(props)
    }

    render() { 
        return (
            <div className="col-11 col-md border">
                <div className="row">
                    <div className="col-7" style={{margin: 'auto 0px'}}>
                        <label className="col-12 mb-0">NHAP MON LAP TRINH</label>
                        <span>----------------------------------</span>
                        <p className="mb-0">some dummy text</p>
                        <span>----------------------------------</span>
                        <label className="col-12 text-right">by hdtien</label>
                    </div>
                    <div className="col-5">
                        <img src={BookImage[0]} style={{width: "75%", margin: '20px auto'}}/>
                    </div>

                </div>
            </div>
        )
    }
}
